const getStatusColors = (status:RegionStatusType) => {
    const colors = {
        active: {
            dot: '#726BEA',
            ring: 'rgba(114, 107, 234, 0.2)'
        },
        critical: {
            dot: '#E11D48',
            ring: 'rgba(225, 29, 72, 0.2)'
        },
        success: {
            dot: '#10B981',
            ring: 'rgba(16, 185, 129, 0.2)'
        },
        pending: {
            dot: '#40444D',
            ring: 'rgba(77, 81, 90, 0.2)'
        },
        inactive: {
            dot: '#F3F6F9',
            ring: '#FFFFFF'
        }
    };
    return colors[status] || colors.inactive;
};

